  false,\n\t\"url\": null,\n\t\"notes\": \"Field data collection was conducted for
  the U.S. Army Engineer District, Pacific Ocean, Honolulu (POH), during August 9
  - September 14, 2005, off Kailua, Lanikai, and Waimanalo, Oahu, Hawaii. Wave and
  current data were collected at five fixed locations using bottom-mounted RD Instruments
  Workhorse, 1.2 MHz, ADCPs (Acoustic Doppler Current Profilers) and Sontek Hydra
  ADVs (Acoustic Doppler Velocimeters). The ADCPs include wave measurements. Four
  inexpensive current drogues (drifters) were designed and built at the CHL Field
  Research Facility (FRF) that used GPS tracking and radio telemetry for positioning.
  Deployments were made on 10 August and 13 September. June.\",\n\t\"owner_org\":
